import PictureCard from "./PictureCard";

const Pictures = ({ feed, user }) => {
  return (
    <div>
      <h1>My Art</h1>
      {feed.map((pic) => {
        return <PictureCard post={pic} />;
      })}
    </div>
  );
};

export default Pictures;
